package no.jib.parkering;

public class LogoLib {
	private String logodata = "";

	public BufferedImage getLogo() {
		byte[] imageBytes = javax.xml.bind.DatatypeConverter.parseBase64Binary(logodata);
		BufferedImage imgtmp = ImageIO.read(new ByteArrayInputStream(imageBytes));
		return imgtmp;
	}

	public byte[] getLogoBytes() {
		byte[] imageBytes = javax.xml.bind.DatatypeConverter.parseBase64Binary(logodata);
		return imageBytes;
	}
}
